import { useState } from 'react';
import './App.css';

function App() {
  const [formData, setFormData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    phone: '',
    experience: '',
    education: '',
    skills: ''
  });

  const [resume, setResume] = useState(null);

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    setResume(formData);
  };

  return (
    <div className="App">
      <form className="resume-form" onSubmit={handleSubmit}>
        <label>
          Ім'я:
          <input type="text" name="firstName" value={formData.firstName} onChange={handleChange} required />
        </label>
        <label>
          Прізвище:
          <input type="text" name="lastName" value={formData.lastName} onChange={handleChange} required />
        </label>
        <label>
          Адреса електронної пошти:
          <input type="email" name="email" value={formData.email} onChange={handleChange} required />
        </label>
        <label>
          Номер телефону:
          <input type="tel" name="phone" value={formData.phone} onChange={handleChange} required />
        </label>
        <label>
          Досвід роботи:
          <textarea name="experience" value={formData.experience} onChange={handleChange} required></textarea>
        </label>
        <label>
          Освіта:
          <textarea name="education" value={formData.education} onChange={handleChange} required></textarea>
        </label>
        <label>
          Навички:
          <textarea name="skills" value={formData.skills} onChange={handleChange} required></textarea>
        </label>
        <button type="submit">Згенерувати резюме</button>
      </form>

      {resume && (
        <div className="resume">
          <h2>Резюме</h2>
          <p><strong>Ім'я:</strong> {resume.firstName}</p>
          <p><strong>Прізвище:</strong> {resume.lastName}</p>
          <p><strong>Адреса електронної пошти:</strong> {resume.email}</p>
          <p><strong>Номер телефону:</strong> {resume.phone}</p>
          <p><strong>Досвід роботи:</strong> {resume.experience}</p>
          <p><strong>Освіта:</strong> {resume.education}</p>
          <p><strong>Навички:</strong> {resume.skills}</p>
        </div>
      )}
    </div>
  );
}

export default App;
